import React from 'react';
import './Timer.css';

class Timer extends React.Component {
  clicked() {
    console.log("Hi Timer!");
  }
  render() {
    return (
      <button className='Timer' onClick={this.clicked}>Hello Timer!</button>
    );
  }
}

export default Timer;
